  "title" : "Ankara Misket Dance (Chiptune Electro Swing Version)",
  "description" : "Chiptune electro swing interpretation of the authentic Turkish folk dance \"Misket Havasi\" from Ankara region.\r\n\r\niTunes: http://bit.ly/16dr3cq\r\nSpotify: http://spoti.fi/17NWH5N\r\nBandcamp: http://bit.ly/13H8E92\r\nLoudr: http://bit.ly/1n7Zcqa\r\n\r\nSearch \"Analog Sheep\" in your favorite music app!\r\nAvailable on 100 digital music providers.\r\n\r\nMisket Dance (Misket Havasi) is an interesting folk dance from Ankara region of Turkey with a melody appearing only on off-beats. 3rd and 4th 16th's are also used a lot to embellish melodies. Originally the dancers accompany the music with a special rhythm played with a couple of wooden spoons in each hand (Here, the same rhythm is played with small finger cymbals).\r\n\r\nA few number of authentic songs of this style are very popular at Turkish wedding celebrations. 10-20 minutes of sets made of Ankara style dances are played at almost all wedding celebrations. In addition to that, still there is a great number of songs created using the same musical style, its own urban subculture is already emerged especially around Ankara the capital city of Turkey. \r\n\r\nOriginally the piece is made on request for a video game for children on iOS, \"Misket ile Kismet, Bir Ankara Macerasi\" (Misket and Kismet, an Ankara Adventure) by Zbam Games and Municipality of Ankara.\r\n\r\n\"Do synhtesizers dream of Analog Sheep?\"\r\nwww.analogsheep.com\r\nwww.facebook.com/analogsheep\r\nwww.twitter.com/theAnalogSheep\r\n\r\nReleased 01 July 2013 \r\nComposed & produced by Guney Ozsan.",
